import axios from "axios";
import React, { useState } from "react";
import { useHistory, useParams } from "react-router-dom";
import Spinner from "./Parts/Spinner";

function CDMDetail(props) {
  const { id } = useParams();
  let history = useHistory;
  const [isLoading, setLoading] = useState(true);
  axios
    .get("https://mm010221.herokuapp.com/shame/" + id)
    .then((res) => {
      setLoading(false);
      console.log(res);
    })
    .catch((err) => {
      console.log(err);
    });
  return (
    <div className="w-full items-center justify-center px-1">
      <h1 className="text-xl md:text-3xl font-black text-gray-600 text-center my-4 tracking-wider">
        Public Shaming List
      </h1>
      <hr />
      {isLoading ? <Spinner /> : ""}
      <div
        className={`wrapper w-full md:w-3/5 mx-auto py-2 my-4 border border-gray-300 rounded-md ${
          isLoading ? "hidden" : ""
        }`}
      ></div>
    </div>
  );
}

export default CDMDetail;
